/**
 * Derive unique country ISO-2 codes from an array of subnational codes.
 * Extracts the two-character prefix before the dash (e.g. 'KE-01' -> 'KE').
 */
export function countriesForSubnational(codes: string[]): string[] {
  const set = new Set<string>();
  for (const code of codes) {
    const dash = code.indexOf('-');
    if (dash >= 2) {
      set.add(code.substring(0, dash));
    }
  }
  return Array.from(set).sort();
}
